import './App.css';
import history from './history';
import Button from "./Components/Buttons";
import React from "react";
import Wrapper from "./Components/Wrapper";
import Title from "./Components/Title";

function App()  {
    return (
        <Wrapper>
            <Title main = {"Welcome to Money Jars"}/>
            <div className="Home">
                <img src="https://www.tucantravel.com/blog/wp-content/uploads/2019/08/Glass-jars-with-dollars-and-text-housecar-travel-education-Image.jpg" alt="jars" width="200" height="390"/>
                <div className="lander">
                    <form>
                        <Button type ="button"
                                buttonStyle="btn--solid--solid"
                                buttonSize="btn-small" onClick={() => history.push("/login")}>Login</Button>
                        &nbsp;&nbsp;&nbsp;
                        <Button type ="button"
                                buttonStyle="btn--danger--solid"
                                buttonSize="btn-small" onClick={() =>  history.push("/signup")}>Sign Up</Button>
                    </form>
                </div>
            </div>
        </Wrapper>
    );
}

export default App;
